nProgramming (Python, JS, etc.),\nAI / Machine Learning,\nBlockchain / Web3,\nCloud / DevOps,\nระบุ2','ระบบตรวจสอบธุรกรรมต้องสงสัย,\nระบบเตือนภัยบัญชีม้า,\nDashboard วิเคราะห์ความผิดปกติในเครือข่าย,\nOSINT investigation tools,\nระบุ1'),(296,'btj0nkde71jrc1ulzzap46j6','2025-05-12 03:35:56.542000','2025-05-12 03:35:56.542000',NULL,NULL,NULL,NULL,'ยามินครบาล','---\n\nหัวข้อที่สนใจ (เลือกได้มากกว่า 1 ข้อ):\n\nระบบตรวจสอบธุรกรรมต้องสงสัย\n\nระบบเตือนภัยบัญชีม้า\n\nDashboard วิเคราะห์ความผิดปกติในเครือข่าย\n\nOSINT investigation tools\n\n\nแรงบันดาลใจและเป้าหมายในการเข้าร่วมการแข่งขัน:\nดิฉัน/ผมมีความสนใจด้านความปลอดภัยทางไซเบอร์และการวิเคราะห์ข้อมูล โดยเฉพาะในเรื่องการตรวจจับพฤติกรรมที่ผิดปกติและการสืบสวนผ่านแหล่งข้อมูลเปิด (OSINT) การเข้าร่วมการแข่งขันครั้งนี้ถือเป็นโอกาสในการฝึกทักษะจริง ร่วมมือกับผู้เชี่ยวชาญ และนำความรู้ไปต่อยอดสร้างระบบที่สามารถช่วยลดความเสี่ยงจากอาชญากรรมทางการเงิน เป้าหมายหลักคือการสร้างต้นแบบระบบที่สามารถตรวจจับและแจ้งเตือนพฤติกรรมที่อาจเชื่อมโยงกับบัญชีม้าหรือธุรกรรมต้องสงสัยได้อย่างแม่นยำและทันเวลา เพื่อสนับสนุนงานของหน่วยงานที่เกี่ยวข้อง\n\n\n---','---\n\nความคาดหวังจากกิจกรรมนี้:\nผม/ดิฉันคาดหวังว่าจะได้พัฒนาทักษะด้านการวิเคราะห์ข้อมูลและความมั่นคงปลอดภัยทางไซเบอร์ รวมถึงได้แลกเปลี่ยนความรู้กับผู้เข้าร่วมและผู้เชี่ยวชาญในสายงาน หวังว่าจะได้สร้างเครือข่ายกับผู้มีความสนใจคล้ายกัน และมีโอกาสต่อยอดแนวคิดที่พัฒนาให้กลายเป็นโปรดักต์จริงที่สามารถใช้งานได้ในภาคปฏิบัติ โดยเฉพาะในหน่วยงานที่เกี่ยวข้องกับการสืบสวนหรือป้องกันอาชญากรรมทางการเงิน\n\n\n---','Cloud / DevOps,\nBlockchain / Web3,\nAI / Machine Learning,\nCybersecurity,\nEthical Hacking / Penetration Testing,\nProgramming (Python, JS, etc.)','ระบบตรวจสอบธุรกรรมต้องสงสัย,\nระบบเตือนภัยบัญชีม้า,\nDashboard วิเคราะห์ความผิดปกติในเครือข่าย,\nOSINT investigation tools'),(297,'btj0nkde71jrc1ulzzap46j6','2025-05-12 03:35:56.542000','2025-05-12 03:35:56.542000','2025-05-12 03:35:56.557000',NULL,NULL,NULL,'ยามินครบาล','---\n\nหัวข้อที่สนใจ (เลือกได้มากกว่า 1 ข้อ):\n\nระบบตรวจสอบธุรกรรมต้องสงสัย\n\nระบบเ